/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1054_%D0%B3%D0%BE%D0%B4\" title=\"1054 \u0433\u043e\u0434\">1054<\/a>&#160;\u2014 \u041d\u0435\u0443\u0434\u0430\u0447\u0435\u0439 \u0437\u0430\u0432\u0435\u0440\u0448\u0438\u043b\u0438\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C\" title=\"\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\">\u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u0435<\/a> \u043f\u0435\u0440\u0435\u0433\u043e\u0432\u043e\u0440\u044b \u043c\u0435\u0436\u0434\u0443 \u0420\u0438\u043c\u043e\u043c \u0438 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u0435\u043c \u043e \u0441\u0444\u0435\u0440\u0430\u0445 \u0432\u043b\u0438\u044f\u043d\u0438\u044f \u0432 \u042e\u0436\u043d\u043e\u0439 \u0418\u0442\u0430\u043b\u0438\u0438 \u0438 \u043f\u043e \u0440\u044f\u0434\u0443 \u0442\u0435\u043e\u043b\u043e\u0433\u0438\u0447\u0435\u0441\u043a\u0438\u0445 \u0432\u043e\u043f\u0440\u043e\u0441\u043e\u0432. \u041f\u043e\u0441\u043b\u0430\u043d\u043d\u0438\u043a \u043f\u0430\u043f\u044b \u0440\u0438\u043c\u0441\u043a\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B5%D0%B2_IX_(%D0%BF%D0%B0%D0%BF%D0%B0_%D1%80%D0%B8%D0%BC%D1%81%D0%BA%D0%B8%D0%B9)\" class=\"mw-redirect\" title=\"\u041b\u0435\u0432 IX (\u043f\u0430\u043f\u0430 \u0440\u0438\u043c\u0441\u043a\u0438\u0439)\">\u041b\u044c\u0432\u0430 IX<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%83%D0%BC%D0%B1%D0%B5%D1%80%D1%82_(%D0%BA%D0%B0%D1%80%D0%B4%D0%B8%D0%BD%D0%B0%D0%BB)\" class=\"mw-redirect\" title=\"\u0413\u0443\u043c\u0431\u0435\u0440\u0442 (\u043a\u0430\u0440\u0434\u0438\u043d\u0430\u043b)\">\u0413\u0443\u043c\u0431\u0435\u0440\u0442<\/a> \u043f\u043e\u043b\u043e\u0436\u0438\u043b \u043d\u0430 \u0430\u043b\u0442\u0430\u0440\u044c \u0441\u043e\u0431\u043e\u0440\u0430 \u0441\u0432. \u0421\u043e\u0444\u0438\u0438 \u043f\u0430\u043f\u0441\u043a\u0443\u044e \u0431\u0443\u043b\u043b\u0443 \u0441 \u0430\u043d\u0430\u0444\u0435\u043c\u043e\u0439 \u0432 \u0430\u0434\u0440\u0435\u0441 \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0433\u043e \u043f\u0430\u0442\u0440\u0438\u0430\u0440\u0445\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9A%D0%B5%D1%80%D1%83%D0%BB%D0%B0%D1%80%D0%B8%D0%B9\" title=\"\u041c\u0438\u0445\u0430\u0438\u043b \u041a\u0435\u0440\u0443\u043b\u0430\u0440\u0438\u0439\">\u041c\u0438\u0445\u0430\u0438\u043b\u0430 \u041a\u0438\u0440\u0443\u043b\u0430\u0440\u0438\u044f<\/a>. \u041f\u0430\u0442\u0440\u0438\u0430\u0440\u0445, \u0432 \u0441\u0432\u043e\u044e \u043e\u0447\u0435\u0440\u0435\u0434\u044c, \u043f\u0440\u043e\u043a\u043b\u044f\u043b \u043f\u043e\u0441\u043b\u0430\u043d\u043d\u0438\u043a\u0430 \u0438 \u0432\u0441\u0435\u0445 \u0447\u043b\u0435\u043d\u043e\u0432 \u0435\u0433\u043e \u0434\u0435\u043b\u0435\u0433\u0430\u0446\u0438\u0438. \u0425\u0440\u0438\u0441\u0442\u0438\u0430\u043d\u0441\u043a\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c \u0440\u0430\u0437\u0434\u0435\u043b\u0438\u043b\u0430\u0441\u044c \u043d\u0430 \u0434\u0432\u0435 \u0432\u0435\u0442\u0432\u0438: \u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0443\u044e \u0438 \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u0443\u044e.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1439_%D0%B3%D0%BE%D0%B4\" title=\"1439 \u0433\u043e\u0434\">1439<\/a>&#160;\u2014 \u0412 \u0410\u043d\u0433\u043b\u0438\u0438 \u0437\u0430\u043f\u0440\u0435\u0449\u0435\u043d\u044b \u043f\u043e\u0446\u0435\u043b\u0443\u0438. \u041f\u0440\u0438\u0447\u0438\u043d\u0430&#160;\u2014 \u044d\u043f\u0438\u0434\u0435\u043c\u0438\u044f \u0447\u0443\u043c\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1548_%D0%B3%D0%BE%D0%B4\" title=\"1548 \u0433\u043e\u0434\">1548<\/a>&#160;\u2014 \u0418\u0441\u043f\u0430\u043d\u0446\u0430\u043c\u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0-%D0%9F%D0%B0%D1%81_(%D0%91%D0%BE%D0%BB%D0%B8%D0%B2%D0%B8%D1%8F)\" title=\"\u041b\u0430-\u041f\u0430\u0441 (\u0411\u043e\u043b\u0438\u0432\u0438\u044f)\">\u041b\u0430-\u041f\u0430\u0441<\/a>. \u0413\u043e\u0440\u043e\u0434 \u043d\u0430\u0437\u0432\u0430\u043d \u0442\u0430\u043a (La Paz&#160;\u2014 \u043f\u043e-\u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438 \u00ab\u043c\u0438\u0440\u00bb) \u0432 \u0447\u0435\u0441\u0442\u044c \u043f\u0440\u0438\u043c\u0438\u0440\u0435\u043d\u0438\u044f \u0434\u043e\u043b\u0433\u043e \u0432\u0440\u0430\u0436\u0434\u043e\u0432\u0430\u0432\u0448\u0438\u0445 \u043c\u0435\u0436\u0434\u0443 \u0441\u043e\u0431\u043e\u0439 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0445 \u0437\u0430\u0432\u043e\u0435\u0432\u0430\u0442\u0435\u043b\u0435\u0439.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1611_%D0%B3%D0%BE%D0%B4\" title=\"1611 \u0433\u043e\u0434\">1611<\/a>&#160;\u2014 \u0417\u0430\u0445\u0432\u0430\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%B3%D0%BE%D1%80%D0%BE%D0%B4\" class=\"mw-redirect\" title=\"\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\">\u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0430<\/a> \u0448\u0432\u0435\u0434\u0430\u043c\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1643_%D0%B3%D0%BE%D0%B4\" title=\"1643 \u0433\u043e\u0434\">1643<\/a>&#160;\u2014 \u042d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f \u0433\u043e\u043b\u043b\u0430\u043d\u0434\u0441\u043a\u043e\u0433\u043e \u043c\u043e\u0440\u0435\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044f \u0434\u0435 \u0424\u0440\u0438\u0437\u0430 (Maarten Gerritszoon Vries) \u043e\u0442\u043a\u0440\u044b\u043b\u0430 \u043e. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D1%85%D0%B0%D0%BB%D0%B8%D0%BD\" title=\"\u0421\u0430\u0445\u0430\u043b\u0438\u043d\">\u0421\u0430\u0445\u0430\u043b\u0438\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1652_%D0%B3%D0%BE%D0%B4\" title=\"1652 \u0433\u043e\u0434\">1652<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0443<\/a> \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0435\u043d\u044b \u043c\u043e\u0449\u0438 \u0441\u0432\u044f\u0442\u043e\u0433\u043e \u043c\u0443\u0447\u0435\u043d\u0438\u043a\u0430 \u043c\u0438\u0442\u0440\u043e\u043f\u043e\u043b\u0438\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF_(%D0%9A%D0%BE%D0%BB%D1%8B%D1%87%D1%91%D0%B2)\" class=\"mw-redirect\" title=\"\u0424\u0438\u043b\u0438\u043f\u043f (\u041a\u043e\u043b\u044b\u0447\u0451\u0432)\">\u0424\u0438\u043b\u0438\u043f\u043f\u0430<\/a>, \u0432\u044b\u0441\u0442\u0443\u043f\u0430\u0432\u0448\u0435\u0433\u043e \u0432 \u0441\u0432\u043e\u0451 \u0432\u0440\u0435\u043c\u044f \u043f\u0440\u043e\u0442\u0438\u0432 \u043f\u043e\u043b\u0438\u0442\u0438\u043a\u0438 \u043e\u043f\u0440\u0438\u0447\u043d\u0438\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%B2%D0%B0%D0%BD_%D0%93%D1%80%D0%BE%D0%B7%D0%BD%D1%8B%D0%B9\" title=\"\u0418\u0432\u0430\u043d \u0413\u0440\u043e\u0437\u043d\u044b\u0439\">\u0418\u0432\u0430\u043d\u0430 \u0413\u0440\u043e\u0437\u043d\u043e\u0433\u043e<\/a> \u0438 \u043f\u043e\u043f\u0430\u0432\u0448\u0435\u0433\u043e \u0437\u0430 \u044d\u0442\u043e \u0432 \u043e\u043f\u0430\u043b\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1661_%D0%B3%D0%BE%D0%B4\" title=\"1661 \u0433\u043e\u0434\">1661<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0435 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0435 \u0431\u0430\u043d\u043a\u043d\u043e\u0442\u044b \u0432\u044b\u043f\u0443\u0449\u0435\u043d\u044b \u0421\u0442\u043e\u043a\u0433\u043e\u043b\u044c\u043c\u0441\u043a\u0438\u043c \u0431\u0430\u043d\u043a\u043e\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1769_%D0%B3%D0%BE%D0%B4\" title=\"1769 \u0433\u043e\u0434\">1769<\/a>&#160;\u2014 \u0418\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0439 \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c <a href=\"https:\/\/ru.wikipedia.org\/w\/index.php?title=%D0%9F%D0%BE%D1%80%D1%82%D0%BE%D0%BB%D0%B0,_%D0%93%D0%B0%D1%81%D0%BF%D0%B0%D1%80_%D0%B4%D0%B5&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u041f\u043e\u0440\u0442\u043e\u043b\u0430, \u0413\u0430\u0441\u043f\u0430\u0440 \u0434\u0435 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0413\u0430\u0441\u043f\u0430\u0440 \u0434\u0435 \u041f\u043e\u0440\u0442\u043e\u043b\u0430<\/a> (Gaspar de Portol\u00e0) \u043e\u0441\u043d\u043e\u0432\u0430\u043b \u0431\u0430\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD-%D0%94%D0%B8%D0%B5%D0%B3%D0%BE_(%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0421\u0430\u043d-\u0414\u0438\u0435\u0433\u043e (\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f)\">\u0421\u0430\u043d-\u0414\u0438\u0435\u0433\u043e<\/a> \u0434\u043b\u044f \u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%BB%D0%B8%D1%84%D0%BE%D1%80%D0%BD%D0%B8%D1%8F\" title=\"\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u044f\">\u041a\u0430\u043b\u0438\u0444\u043e\u0440\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1790_%D0%B3%D0%BE%D0%B4\" title=\"1790 \u0433\u043e\u0434\">1790<\/a>&#160;\u2014 \u041e\u043a\u0440\u0443\u0433 \u041a\u043e\u043b\u0443\u043c\u0431\u0438\u044f, \u043d\u0435 \u0432\u0445\u043e\u0434\u044f\u0449\u0438\u0439 \u0432 \u044e\u0440\u0438\u0441\u0434\u0438\u043a\u0446\u0438\u044e \u043d\u0438 \u043e\u0434\u043d\u043e\u0433\u043e \u0448\u0442\u0430\u0442\u0430, \u043e\u043f\u0440\u0435\u0434\u0435\u043b\u0451\u043d \u043a\u0430\u043a \u043c\u0435\u0441\u0442\u043e\u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u0438\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 \u0421\u0428\u0410.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1795_%D0%B3%D0%BE%D0%B4\" title=\"1795 \u0433\u043e\u0434\">1795<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%BA%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D0%B0_II\" title=\"\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II\">\u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u0430 II<\/a> \u0443\u0447\u0440\u0435\u0434\u0438\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%BB%D1%8B%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u043e\u043b\u044b\u043d\u0441\u043a\u0430\u044f \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u044f\">\u0412\u043e\u043b\u044b\u043d\u0441\u043a\u0443\u044e \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u044e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1814_%D0%B3%D0%BE%D0%B4\" title=\"1814 \u0433\u043e\u0434\">1814<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u0430\u044f \u043f\u0443\u0431\u043b\u0438\u043a\u0430\u0446\u0438\u044f \u0432 \u043f\u0435\u0447\u0430\u0442\u0438 (\u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0435\u043d\u0438\u0435 \u00ab\u041a \u0434\u0440\u0443\u0433\u0443 \u0441\u0442\u0438\u0445\u043e\u0442\u0432\u043e\u0440\u0446\u0443\u00bb) \u044e\u043d\u043e\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%88%D0%BA%D0%B8%D0%BD,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041f\u0443\u0448\u043a\u0438\u043d, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0433\u0435\u0435\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u0430 \u041f\u0443\u0448\u043a\u0438\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1819_%D0%B3%D0%BE%D0%B4\" title=\"1819 \u0433\u043e\u0434\">1819<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u0430\u0441\u044c \u043a\u0440\u0443\u0433\u043e\u0441\u0432\u0435\u0442\u043d\u0430\u044f \u044d\u043a\u0441\u043f\u0435\u0434\u0438\u0446\u0438\u044f \u0448\u043b\u044e\u043f\u043e\u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA_(%D1%88%D0%BB%D1%8E%D0%BF)\" title=\"\u0412\u043e\u0441\u0442\u043e\u043a (\u0448\u043b\u044e\u043f)\">\u00ab\u0412\u043e\u0441\u0442\u043e\u043a\u00bb<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B8%D1%80%D0%BD%D1%8B%D0%B9_(%D1%81%D1%83%D0%B4%D0%BD%D0%BE)\" class=\"mw-redirect\" title=\"\u041c\u0438\u0440\u043d\u044b\u0439 (\u0441\u0443\u0434\u043d\u043e)\">\u00ab\u041c\u0438\u0440\u043d\u044b\u0439\u00bb<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c \u041c. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B0%D0%B7%D0%B0%D1%80%D0%B5%D0%B2,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041b\u0430\u0437\u0430\u0440\u0435\u0432, \u041c\u0438\u0445\u0430\u0438\u043b \u041f\u0435\u0442\u0440\u043e\u0432\u0438\u0447\">\u041f. \u041b\u0430\u0437\u0430\u0440\u0435\u0432\u0430<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D0%BB%D0%B8%D0%BD%D1%81%D0%B3%D0%B0%D1%83%D0%B7%D0%B5%D0%BD,_%D0%A4%D0%B0%D0%B4%D0%B4%D0%B5%D0%B9_%D0%A4%D0%B0%D0%B4%D0%B4%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u0411\u0435\u043b\u043b\u0438\u043d\u0441\u0433\u0430\u0443\u0437\u0435\u043d, \u0424\u0430\u0434\u0434\u0435\u0439 \u0424\u0430\u0434\u0434\u0435\u0435\u0432\u0438\u0447\">\u0424.&#160;\u0424.&#160;\u0411\u0435\u043b\u043b\u0438\u043d\u0441\u0433\u0430\u0443\u0437\u0435\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1844_%D0%B3%D0%BE%D0%B4\" title=\"1844 \u0433\u043e\u0434\">1844<\/a>&#160;\u2014 \u0412\u0434\u043e\u0432\u0430 \u0410.&#160;\u0421.&#160;\u041f\u0443\u0448\u043a\u0438\u043d\u0430 \u041d\u0430\u0442\u0430\u043b\u044c\u044f \u041f\u0443\u0448\u043a\u0438\u043d\u0430 \u0432\u0442\u043e\u0440\u0438\u0447\u043d\u043e \u0432\u044b\u0448\u043b\u0430 \u0437\u0430\u043c\u0443\u0436 (\u0437\u0430 \u0433\u0435\u043d\u0435\u0440\u0430\u043b\u0430 \u041f. \u041b\u0430\u043d\u0441\u043a\u043e\u0433\u043e).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1850_%D0%B3%D0%BE%D0%B4\" title=\"1850 \u0433\u043e\u0434\">1850<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u043e\u0433\u0440\u0430\u043d\u0438\u0447\u0435\u043d\u0430 \u0441\u0432\u043e\u0431\u043e\u0434\u0430 \u043f\u0435\u0447\u0430\u0442\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1867_%D0%B3%D0%BE%D0%B4\" title=\"1867 \u0433\u043e\u0434\">1867<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%8B\" title=\"\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u044b\">\u0424\u0440\u0430\u043d\u0446\u0443\u0437<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D1%8C%D0%B5,_%D0%96%D0%BE%D0%B7%D0%B5%D1%84\" title=\"\u041c\u043e\u043d\u044c\u0435, \u0416\u043e\u0437\u0435\u0444\">\u0416\u043e\u0437\u0435\u0444 \u041c\u043e\u043d\u044c\u0435<\/a>, \u0431\u044b\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%B4%D0%BE%D0%B2%D0%BD%D0%B8%D0%BA\" title=\"\u0421\u0430\u0434\u043e\u0432\u043d\u0438\u043a\">\u0441\u0430\u0434\u043e\u0432\u043d\u0438\u043a<\/a>, \u043f\u043e\u043b\u0443\u0447\u0438\u043b \u043f\u0430\u0442\u0435\u043d\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%B4%D0%B2%D0%B0%D1%80%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE_%D0%BD%D0%B0%D0%BF%D1%80%D1%8F%D0%B6%D1%91%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BE%D0%B1%D0%B5%D1%82%D0%BE%D0%BD\" title=\"\u041f\u0440\u0435\u0434\u0432\u0430\u0440\u0438\u0442\u0435\u043b\u044c\u043d\u043e \u043d\u0430\u043f\u0440\u044f\u0436\u0451\u043d\u043d\u044b\u0439 \u0436\u0435\u043b\u0435\u0437\u043e\u0431\u0435\u0442\u043e\u043d\">\u0430\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u044b\u0439<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D1%82%D0%BE%D0%BD\" title=\"\u0411\u0435\u0442\u043e\u043d\">\u0431\u0435\u0442\u043e\u043d<\/a>, \u0441\u0442\u0430\u0432\u0448\u0438\u0439 \u0433\u043b\u0430\u0432\u043d\u044b\u043c \u043c\u0430\u0442\u0435\u0440\u0438\u0430\u043b\u043e\u043c \u043f\u0440\u0438 \u0432\u043e\u0437\u0432\u0435\u0434\u0435\u043d\u0438\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%B1%D0%BE%D1%81%D0%BA%D1%80%D1%91%D0%B1\" title=\"\u041d\u0435\u0431\u043e\u0441\u043a\u0440\u0451\u0431\">\u0432\u044b\u0441\u043e\u0442\u043d\u044b\u0445 \u0437\u0434\u0430\u043d\u0438\u0439<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1877_%D0%B3%D0%BE%D0%B4\" title=\"1877 \u0433\u043e\u0434\">1877<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0439 \u0444\u0438\u043d\u0430\u043b \u0442\u0435\u043d\u043d\u0438\u0441\u043d\u043e\u0433\u043e \u0442\u0443\u0440\u043d\u0438\u0440\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%B8%D0%BC%D0%B1%D0%BB%D0%B4%D0%BE%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D1%83%D1%80%D0%BD%D0%B8%D1%80\" title=\"\u0423\u0438\u043c\u0431\u043b\u0434\u043e\u043d\u0441\u043a\u0438\u0439 \u0442\u0443\u0440\u043d\u0438\u0440\">\u0423\u0438\u043c\u0431\u043b\u0434\u043e\u043d\u0435<\/a>. \u041f\u043e\u0431\u0435\u0434\u0438\u0442\u0435\u043b\u0435\u043c \u0441\u0442\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%BE%D1%80,_%D0%A1%D0%BF%D0%B5%D0%BD%D1%81%D0%B5%D1%80_(%D1%82%D0%B5%D0%BD%D0%BD%D0%B8%D1%81%D0%B8%D1%81%D1%82)\" class=\"mw-redirect\" title=\"\u0413\u043e\u0440, \u0421\u043f\u0435\u043d\u0441\u0435\u0440 (\u0442\u0435\u043d\u043d\u0438\u0441\u0438\u0441\u0442)\">\u0421\u043f\u0435\u043d\u0441\u0435\u0440 \u0413\u043e\u0440<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1896_%D0%B3%D0%BE%D0%B4\" title=\"1896 \u0433\u043e\u0434\">1896<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D1%8B%D0%B9_%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B8%D0%B9_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u041f\u0435\u0440\u0432\u044b\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c\">\u041f\u0435\u0440\u0432\u044b\u0439 \u0440\u0443\u0441\u0441\u043a\u0438\u0439 \u0430\u0432\u0442\u043e\u043c\u043e\u0431\u0438\u043b\u044c<\/a> \u0431\u044b\u043b \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d \u043f\u0443\u0431\u043b\u0438\u043a\u0435 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D1%81%D0%B5%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0_1896\" class=\"mw-redirect\" title=\"\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430 1896\">\u0412\u0441\u0435\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u043e\u0439 \u043f\u0440\u043e\u043c\u044b\u0448\u043b\u0435\u043d\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u043e\u0439 \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0435 \u0432 \u041d\u0438\u0436\u043d\u0435\u043c \u041d\u043e\u0432\u0433\u043e\u0440\u043e\u0434\u0435<\/a>, \u0437\u0430 \u0440\u0443\u043b\u0435\u043c \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0431\u044b\u043b\u0438 \u0435\u0433\u043e \u0441\u043e\u0437\u0434\u0430\u0442\u0435\u043b\u0438&#160;\u2014 \u043e\u0442\u0441\u0442\u0430\u0432\u043d\u043e\u0439 \u043b\u0435\u0439\u0442\u0435\u043d\u0430\u043d\u0442 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u0432\u043e\u0435\u043d\u043d\u043e-\u043c\u043e\u0440\u0441\u043a\u043e\u0433\u043e \u0444\u043b\u043e\u0442\u0430 \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u042f\u043a\u043e\u0432\u043b\u0435\u0432 \u0438 \u0445\u043e\u0437\u044f\u0438\u043d \u043a\u0430\u0440\u0435\u0442\u043d\u044b\u0445 \u043c\u0430\u0441\u0442\u0435\u0440\u0441\u043a\u0438\u0445 \u041f\u0435\u0442\u0440 \u0424\u0440\u0435\u0437\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1909_%D0%B3%D0%BE%D0%B4\" title=\"1909 \u0433\u043e\u0434\">1909<\/a>&#160;\u2014 \u041e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Audi\" title=\"Audi\">Audi<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1917_%D0%B3%D0%BE%D0%B4\" title=\"1917 \u0433\u043e\u0434\">1917<\/a>&#160;\u2014 \u041d\u0430\u0447\u0430\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%8E%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%B2%D0%BE%D1%81%D1%81%D1%82%D0%B0%D0%BD%D0%B8%D0%B5_(1917)\" class=\"mw-redirect\" title=\"\u0418\u044e\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435 (1917)\">\u0418\u044e\u043b\u044c\u0441\u043a\u043e\u0435 \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435<\/a> \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0440\u043e\u0433\u0440\u0430\u0434\u0435<\/a>&#160;\u2014 \u043f\u043e \u043f\u0440\u0438\u0437\u044b\u0432\u0443 \u0430\u043d\u0430\u0440\u0445\u0438\u0441\u0442\u043e\u0432 \u0441\u043e\u043b\u0434\u0430\u0442\u