e\u0432\u0435\u043a. \u041a\u0440\u0443\u043f\u043d\u0435\u0439\u0448\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0434\u043e\u0440\u043e\u0436\u043d\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1947_%D0%B3%D0%BE%D0%B4\" title=\"1947 \u0433\u043e\u0434\">1947<\/a>&#160;\u2014 \u041f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u0442\u0435\u043b\u0438 16 \u0435\u0432\u0440\u043e\u043f\u0435\u0439\u0441\u043a\u0438\u0445 \u0433\u043e\u0441\u0443\u0434\u0430\u0440\u0441\u0442\u0432 \u0441\u043e\u0431\u0440\u0430\u043b\u0438\u0441\u044c \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6\" title=\"\u041f\u0430\u0440\u0438\u0436\">\u041f\u0430\u0440\u0438\u0436\u0435<\/a> \u0434\u043b\u044f \u043e\u0431\u0441\u0443\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BB%D0%B0%D0%BD_%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB%D0%BB%D0%B0\" title=\"\u041f\u043b\u0430\u043d \u041c\u0430\u0440\u0448\u0430\u043b\u043b\u0430\">\u043f\u043b\u0430\u043d\u0430 \u041c\u0430\u0440\u0448\u0430\u043b\u043b\u0430<\/a> \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u043e\u0432\u043b\u0435\u043d\u0438\u044f \u044d\u043a\u043e\u043d\u043e\u043c\u0438\u043a\u0438 \u0415\u0432\u0440\u043e\u043f\u044b (\u0434\u043e 15 \u0438\u044e\u043b\u044f).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1950_%D0%B3%D0%BE%D0%B4\" title=\"1950 \u0433\u043e\u0434\">1950<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D0%BD%D0%B0%D1%81%D0%BE\" class=\"mw-redirect\" title=\"\u041c\u0430\u0440\u0430\u043a\u0430\u043d\u0430\u0441\u043e\">\u041c\u0430\u0440\u0430\u043a\u0430\u043d\u0430\u0441\u043e<\/a>&#160;\u2014 \u0440\u0435\u0448\u0430\u044e\u0449\u0438\u0439 \u043c\u0430\u0442\u0447 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82_%D0%BC%D0%B8%D1%80%D0%B0_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_1950\" title=\"\u0427\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442 \u043c\u0438\u0440\u0430 \u043f\u043e \u0444\u0443\u0442\u0431\u043e\u043b\u0443 1950\">\u0447\u0435\u043c\u043f\u0438\u043e\u043d\u0430\u0442\u0430 \u043c\u0438\u0440\u0430 \u043f\u043e \u0444\u0443\u0442\u0431\u043e\u043b\u0443 1950<\/a>, \u0441\u043e\u0431\u0440\u0430\u0432\u0448\u0438\u0439 \u0440\u0435\u043a\u043e\u0440\u0434\u043d\u043e\u0435 \u0447\u0438\u0441\u043b\u043e \u0437\u0440\u0438\u0442\u0435\u043b\u0435\u0439 \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0444\u0443\u0442\u0431\u043e\u043b\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1951_%D0%B3%D0%BE%D0%B4\" title=\"1951 \u0433\u043e\u0434\">1951<\/a>&#160;\u2014 \u041e\u043f\u0443\u0431\u043b\u0438\u043a\u043e\u0432\u0430\u043d\u0430 \u043f\u043e\u0432\u0435\u0441\u0442\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%8D%D0%BB%D0%B8%D0%BD%D0%B4%D0%B6%D0%B5%D1%80,_%D0%94%D0%B6%D0%B5%D1%80%D0%BE%D0%BC_%D0%94%D1%8D%D0%B2%D0%B8%D0%B4\" title=\"\u0421\u044d\u043b\u0438\u043d\u0434\u0436\u0435\u0440, \u0414\u0436\u0435\u0440\u043e\u043c \u0414\u044d\u0432\u0438\u0434\">\u0414\u0436. \u0421\u044d\u043b\u0438\u043d\u0434\u0436\u0435\u0440\u0430<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%B4_%D0%BF%D1%80%D0%BE%D0%BF%D0%B0%D1%81%D1%82%D1%8C%D1%8E_%D0%B2%D0%BE_%D1%80%D0%B6%D0%B8\" title=\"\u041d\u0430\u0434 \u043f\u0440\u043e\u043f\u0430\u0441\u0442\u044c\u044e \u0432\u043e \u0440\u0436\u0438\">\u041d\u0430\u0434 \u043f\u0440\u043e\u043f\u0430\u0441\u0442\u044c\u044e \u0432\u043e \u0440\u0436\u0438<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1956_%D0%B3%D0%BE%D0%B4\" title=\"1956 \u0433\u043e\u0434\">1956<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B5%D0%BB%D0%BE-%D0%A4%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0430\u0440\u0435\u043b\u043e-\u0424\u0438\u043d\u0441\u043a\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0430\u0440\u0435\u043b\u043e-\u0424\u0438\u043d\u0441\u043a\u0430\u044f \u0421\u0421\u0420<\/a> \u043f\u0440\u0435\u043e\u0431\u0440\u0430\u0437\u043e\u0432\u0430\u043d\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%90%D0%B2%D1%82%D0%BE%D0%BD%D0%BE%D0%BC%D0%BD%D0%B0%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u041a\u0430\u0440\u0435\u043b\u044c\u0441\u043a\u0430\u044f \u0410\u0432\u0442\u043e\u043d\u043e\u043c\u043d\u0430\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u0430\u044f \u0421\u043e\u0446\u0438\u0430\u043b\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u041a\u0430\u0440\u0435\u043b\u044c\u0441\u043a\u0443\u044e \u0410\u0421\u0421\u0420<\/a> (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0_%D0%9A%D0%B0%D1%80%D0%B5%D0%BB%D0%B8%D1%8F\" title=\"\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041a\u0430\u0440\u0435\u043b\u0438\u044f\">\u0420\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430 \u041a\u0430\u0440\u0435\u043b\u0438\u044f<\/a> \u0432 \u0441\u043e\u0441\u0442\u0430\u0432\u0435 \u0420\u0424).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965_%D0%B3%D0%BE%D0%B4\" title=\"1965 \u0433\u043e\u0434\">1965<\/a><ul><li>\u041e\u0442\u043a\u0440\u044b\u0442 \u0442\u0443\u043d\u043d\u0435\u043b\u044c \u043f\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%BD%D0%B1%D0%BB%D0%B0%D0%BD\" title=\"\u041c\u043e\u043d\u0431\u043b\u0430\u043d\">\u041c\u043e\u043d\u0431\u043b\u0430\u043d\u043e\u043c<\/a> (\u0432\u044b\u0441\u043e\u0447\u0430\u0439\u0448\u0435\u0439 \u0432\u0435\u0440\u0448\u0438\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D0%BF%D1%8B\" title=\"\u0410\u043b\u044c\u043f\u044b\">\u0410\u043b\u044c\u043f<\/a>&#160;\u2014 4807 \u043c), \u0441\u0432\u044f\u0437\u0430\u0432\u0448\u0438\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u044e<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%8F\" title=\"\u0418\u0442\u0430\u043b\u0438\u044f\">\u0418\u0442\u0430\u043b\u0438\u044e<\/a>.<\/li><li>\u041e\u0442\u043a\u0440\u044b\u0442\u0438\u0435 \u043a\u0440\u0430\u0442\u0435\u0440\u043e\u0432 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D1%81_(%D0%BF%D0%BB%D0%B0%D0%BD%D0%B5%D1%82%D0%B0)\" class=\"mw-redirect\" title=\"\u041c\u0430\u0440\u0441 (\u043f\u043b\u0430\u043d\u0435\u0442\u0430)\">\u041c\u0430\u0440\u0441\u0435<\/a> (\u0442\u0435\u043b\u0435\u043f\u0435\u0440\u0435\u0434\u0430\u0447\u0430 \u0441 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D1%80%D0%B8%D0%BD%D0%B5%D1%80-4\" title=\"\u041c\u0430\u0440\u0438\u043d\u0435\u0440-4\">\u041c\u0430\u0440\u0438\u043d\u0435\u0440-4<\/a>\u00bb, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A8%D0%90\" class=\"mw-redirect\" title=\"\u0421\u0428\u0410\">\u0421\u0428\u0410<\/a>).<\/li><li>\u0421 \u043a\u043e\u0441\u043c\u043e\u0434\u0440\u043e\u043c\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B0%D0%B9%D0%BA%D0%BE%D0%BD%D1%83%D1%80\" title=\"\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440\">\u0411\u0430\u0439\u043a\u043e\u043d\u0443\u0440<\/a> \u0443\u0441\u043f\u0435\u0448\u043d\u043e \u043e\u0441\u0443\u0449\u0435\u0441\u0442\u0432\u043b\u0451\u043d \u043f\u0435\u0440\u0432\u044b\u0439 \u0437\u0430\u043f\u0443\u0441\u043a \u0440\u0430\u043a\u0435\u0442\u044b-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%82%D0%BE%D0%BD_(%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%B0-%D0%BD%D0%BE%D1%81%D0%B8%D1%82%D0%B5%D0%BB%D1%8C)\" title=\"\u041f\u0440\u043e\u0442\u043e\u043d (\u0440\u0430\u043a\u0435\u0442\u0430-\u043d\u043e\u0441\u0438\u0442\u0435\u043b\u044c)\">\u041f\u0440\u043e\u0442\u043e\u043d<\/a>, \u043a\u043e\u0442\u043e\u0440\u0430\u044f \u0432\u044b\u0432\u0435\u043b\u0430 \u043d\u0430 \u043e\u043a\u043e\u043b\u043e\u0437\u0435\u043c\u043d\u0443\u044e \u043e\u0440\u0431\u0438\u0442\u0443 \u0441\u043e\u0432\u0435\u0442\u0441\u043a\u0438\u0439 \u043d\u0430\u0443\u0447\u043d\u043e-\u0438\u0441\u0441\u043b\u0435\u0434\u043e\u0432\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0439 \u0441\u043f\u0443\u0442\u043d\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%BE%D1%82%D0%BE%D0%BD_(%D0%9A%D0%90)\" class=\"mw-redirect\" title=\"\u041f\u0440\u043e\u0442\u043e\u043d (\u041a\u0410)\">\u041f\u0440\u043e\u0442\u043e\u043d-1<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966_%D0%B3%D0%BE%D0%B4\" title=\"1966 \u0433\u043e\u0434\">1966<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BB%D1%8D%D0%BF%D1%82%D0%BE%D0%BD,_%D0%AD%D1%80%D0%B8%D0%BA\" title=\"\u041a\u043b\u044d\u043f\u0442\u043e\u043d, \u042d\u0440\u0438\u043a\">\u042d\u0440\u0438\u043a \u041a\u043b\u044d\u043f\u0442\u043e\u043d<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%80%D1%8E%D1%81,_%D0%94%D0%B6%D0%B5%D0%BA\" title=\"\u0411\u0440\u044e\u0441, \u0414\u0436\u0435\u043a\">\u0414\u0436\u0435\u043a \u0411\u0440\u044e\u0441<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%B9%D0%BA%D0%B5%D1%80,_%D0%94%D0%B6%D0%B8%D0%BD%D0%B4%D0%B6%D0%B5%D1%80\" title=\"\u0411\u0435\u0439\u043a\u0435\u0440, \u0414\u0436\u0438\u043d\u0434\u0436\u0435\u0440\">\u0414\u0436\u0438\u043d\u0434\u0436\u0435\u0440 \u0411\u0435\u0439\u043a\u0435\u0440<\/a> \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043b\u0438 \u043f\u0435\u0440\u0432\u0443\u044e \u0441\u0443\u043f\u0435\u0440\u0433\u0440\u0443\u043f\u043f\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/Cream\" title=\"Cream\">Cream<\/a>\u00bb. \u0418\u043c\u0435\u043d\u043d\u043e \u044d\u0442\u043e\u0442 \u0431\u043b\u044e\u0437-\u0440\u043e\u043a\u043e\u0432\u044b\u0439 \u043a\u043e\u043b\u043b\u0435\u043a\u0442\u0438\u0432 \u0432\u0432\u0451\u043b \u0434\u043b\u0438\u043d\u043d\u044b\u0435 \u0433\u0438\u0442\u0430\u0440\u043d\u044b\u0435 \u0438 \u0431\u0430\u0440\u0430\u0431\u0430\u043d\u043d\u044b\u0435 \u0441\u043e\u043b\u043e \u0432 \u0443\u0441\u043b\u043e\u0436\u043d\u0451\u043d\u043d\u043e\u0439 \u043c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0439 \u0444\u0430\u043a\u0442\u0443\u0440\u0435 \u043a\u043e\u043c\u043f\u043e\u0437\u0438\u0446\u0438\u0439, \u043f\u0440\u0438\u0448\u0435\u0434\u0448\u0438\u0445 \u043d\u0430 \u0441\u043c\u0435\u043d\u0443 \u043d\u0435\u0437\u0430\u0442\u0435\u0439\u043b\u0438\u0432\u044b\u043c \u043f\u0435\u0441\u0435\u043d\u043a\u0430\u043c. \u041c\u0443\u0437\u044b\u043a\u0430\u043b\u044c\u043d\u043e\u0435 \u043d\u0430\u043f\u0440\u0430\u0432\u043b\u0435\u043d\u0438\u0435, \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043d\u043d\u043e\u0435 \u00abCream\u00bb, \u0441\u0442\u0430\u043b\u043e \u0434\u043e\u043c\u0438\u043d\u0438\u0440\u0443\u044e\u0449\u0438\u043c \u0432 \u0431\u043b\u044e\u0437\u0435 \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0435 \u0434\u0435\u0441\u044f\u0442\u044c \u043b\u0435\u0442.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968_%D0%B3%D0%BE%D0%B4\" title=\"1968 \u0433\u043e\u0434\">1968<\/a>&#160;\u2014 \u0420\u0443\u043a\u043e\u0432\u043e\u0434\u0438\u0442\u0435\u043b\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u0421\u0421\u0420<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%94%D0%A0\" class=\"mw-redirect\" title=\"\u0413\u0414\u0420\">\u0412\u043e\u0441\u0442\u043e\u0447\u043d\u043e\u0439 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B3%D1%80%D0%B8%D1%8F\" title=\"\u0412\u0435\u043d\u0433\u0440\u0438\u044f\">\u0412\u0435\u043d\u0433\u0440\u0438\u0438<\/a>, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%BE%D0%BB%D1%8C%D1%88%D0%B0\" title=\"\u041f\u043e\u043b\u044c\u0448\u0430\">\u041f\u043e\u043b\u044c\u0448\u0438<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80%D0%B8%D1%8F\" title=\"\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u044f\">\u0411\u043e\u043b\u0433\u0430\u0440\u0438\u0438<\/a> \u0437\u0430\u044f\u0432\u0438\u043b\u0438 \u043e \u043d\u0435\u043f\u0440\u0438\u0435\u043c\u043b\u0435\u043c\u043e\u0441\u0442\u0438 \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u043c\u044b\u0445 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B5%D1%85%D0%BE%D1%81%D0%BB%D0%BE%D0%B2%D0%B0%D0%BA%D0%B8%D1%8F\" title=\"\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u044f\">\u0427\u0435\u0445\u043e\u0441\u043b\u043e\u0432\u0430\u043a\u0438\u0438<\/a> \u0440\u0435\u0444\u043e\u0440\u043c.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a>&#160;\u2014 \u0421\u043f\u0430\u0441\u0